    return(
      <div className="nav">
        <ul>
          <li><button>Наверх</button></li>
        </ul>
        <input type="text" className="" placeholder='Поиск' />
      </div>
    )
  }
}



function App() {
  return (
    <div className="App">
      ewaeawe
    </div>
  );
}

export default App;
